import React, { useEffect, useState } from "react";

export default function Moder() {
    const [announcements, setAnnouncements] = useState([]);

    useEffect(() => {
        const url = new URL("https://api.frossh.uz/api/announcement/get-by-moderation");
        const headers = {
            "Authorization": "Bearer {YOUR_AUTH_KEY}",
            "Content-Type": "application/json",
            "Accept": "application/json",
        };

        fetch(url, {
            method: "GET",
            headers,
        })
        .then(response => response.json())
        .then(data => {
            setAnnouncements(data); // Ma'lumotlarni React state ga saqlash
        })
        .catch(error => {
            console.error('Error fetching data:', error);
        });
    }, []); // useEffect faqat bir martta ishga tushadi, bo'sh massiv yuborilgan

    return (
        <div>
            {/* Ma'lumotlarni ko'rsatish */}
            <ul>
                {announcements.map(announcement => (
                    <li key={announcement.id}>{announcement.title}</li>
                ))}
            </ul>
        </div>
    );
}
